  async function getListOfVisitsCommercial() {
    if(visitList.length !==0 && contactList.length !==0 && dealershipList.length !==0 ){
      let commericalData = visitList.filter((visit)=> visit.type ==="Commercial")
      Promise.all(commericalData.map(async (visit) => {
      let customerName
      let responsiblePerson
      let responsiblePersonRole
      let userDealershipDisplayName
      let conatctUserDetails = allUserList.find((user) => user.uuid === visit.updatedBy)

      if (conatctUserDetails) {
        responsiblePersonRole = conatctUserDetails.roleName
        responsiblePerson = conatctUserDetails.displayName
        if (conatctUserDetails.dealershipID) {
          let userDealership = dealershipList.find((dealer) => dealer.uuid === conatctUserDetails.dealershipID)
            if(userDealership){
              userDealershipDisplayName = userDealership.displayName ? userDealership.displayName : userDealership.name
            }
        }
      }

      let assignUserName
      let assignUserRole
      if (visit.assignUser) {
        let userDetails = allUserList.find((user) => user.uuid === visit.assignUser)
        if (userDetails) {
          assignUserName = userDetails.displayName ? userDetails.displayName : userDetails.name
          assignUserRole = userDetails.roleName ? userDetails.roleName : 'No role'
        }
      }

      let conatctDetails = {}
      let caseIDs
      if (visit.contactID) {
        await Promise.all(contactList.filter((contact) => {
          if(contact.uuid === visit.contactID)
            return contact
        })).then((res)=>{
          conatctDetails =  res[0]
          if (conatctDetails) {
            customerName = conatctDetails.firstName ? conatctDetails.firstName : ''  + " " + conatctDetails.lastName ? conatctDetails.lastName :''
            if (conatctDetails.caseID && visit.caseID) {
              caseIDs = "CASE" + " " + conatctDetails.caseID + ' ' + visit.caseID
            } else {
              caseIDs = "CASE #KH157 #Q160"
            }
          }else{
            conatctDetails={}
          }
        }).catch((err)=> console.log(err))

      }

      //"CASE #KH157 #Q160"
      delete visit.caseID
      delete visit.purpose

      let timeFromDate = visit.date.split(" ")[0].split(":")
      let timeinFromatHH = timeFromDate[0] < 10 ? "0" + timeFromDate[0] : timeFromDate[0]
      let timeinFromatMM = timeFromDate[1]
      let inTime = `${timeinFromatHH}:${timeinFromatMM}`

      let objVisit = {
        displayName: customerName,
        purpose: visit.type,
        typeOfVisit: visit.assignUser ? "Open" : "Unassigned",
        caseID: caseIDs,
        visitTime: visit.date,
        responsiblePerson,
        extraModalName: visit.assignUser ? "View Status" : "Assign SC",
        uuid: visit.uuid,
        responsiblePersonRole,
        userDealershipDisplayName,
        ...visit,
        assignUserName,
        assignUserRole,
        inTime,
        personalDetails: conatctDetails
      }
      return   objVisit
    })).then(async(res)=>{
      let visitDataArray = res
      let unassignedCommericaldata = await getRowsListForVisit(visitDataArray.filter((visit) => visit.typeOfVisit === "Unassigned"))
      unassigedCommercialVisitDataTableData = unassignedCommericaldata
      await setUnassigedCommercialVisitDataTableData(unassigedCommercialVisitDataTableData)
      let openCommericaldata = await getRowsListForVisit(visitDataArray.filter((visit) => visit.typeOfVisit === "Open"))
      await setOpenCommercialVisitDataTableData(openCommericaldata)
      let closedCommericaldata = await getRowsListForVisit(visitDataArray.filter((visit) => visit.status === "Closed"))
      await setClosedCommercialVisitDataTableData(closedCommericaldata)
      setCommercialData(activeFilterForCommerical)
    }).catch((err)=>console.log(err))

    }

  }


